import React from "react";
import GoogleLogin, { GoogleLogout } from "react-google-login";

const clientId =
  "750857203643-198fedjcmj3dmg30tt932d7do9ilkurb.apps.googleusercontent.com";

const onSuccess = (res) => {
  console.log(res.profileObj);
};

const onFailure = (res) => {
  console.log(res);
};

const Login = () => {
  return (
    <>
      <div className="login-btn">
        <GoogleLogin
          buttonText="Đăng nhập bằng tài khoản HOCMAI"
          onSuccess={onSuccess}
          onFailure={onFailure}
          cookiePolicy={"single_host_origin"}
          isSignedIn={true}
        />
      </div>

      <div className="logout-btn">
        <GoogleLogout
          clientId={clientId}
          buttonText="Dang xuat"
          onLogoutSuccess={onLogOutSuccess}
        ></GoogleLogout>
      </div>
    </>
  );
};
export default Login;
